import { getAuth, getIdToken } from "firebase/auth"
import { useSelector } from "react-redux";

const GetToken = () => {
  const user = useSelector((state) => state.auth.value);
  getIdToken(user).then((token) => {
    return token;
  })
}

export default GetToken;
